import React from 'react';

const Navbar = () => {
  const navbarStyle = {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    backgroundColor: 'white',
    padding: '10px 20px',
    borderBottom: '1px solid #ccc',
    width: '100%',
  };

  const logoStyle = {
    fontSize: '24px',
    fontWeight: 'bold',
    color: 'black',
    flex: 1, // Allows the logo to take available space
    textAlign: 'center', // Centers the logo
  };

  const linksStyle = {
    listStyle: 'none',
    display: 'flex',
    gap: '20px',
    margin: 0,
    padding: 0,
    flex: 1, // Allows the links section to take available space
    justifyContent: 'center', // Centers the links horizontally
  };

  const linkStyle = {
    textDecoration: 'none',
    color: 'black',
    fontSize: '16px',
    transition: 'color 0.3s',
  };

  const hoverStyle = (e, isHovering) => {
    e.target.style.color = isHovering ? 'gray' : 'black';
  };

  return (
    <nav style={navbarStyle}>
      <div style={logoStyle}>Upcoming Universe</div>
      <ul style={linksStyle}>
        <li>
          <a
            href="/home"
            style={linkStyle}
            onMouseEnter={(e) => hoverStyle(e, true)}
            onMouseLeave={(e) => hoverStyle(e, false)}
          >
            Home
          </a>
        </li>
        <li>
          <a
            href="/about"
            style={linkStyle}
            onMouseEnter={(e) => hoverStyle(e, true)}
            onMouseLeave={(e) => hoverStyle(e, false)}
          >
            About
          </a>
        </li>
        <li>
          <a
            href="/blogs"
            style={linkStyle}
            onMouseEnter={(e) => hoverStyle(e, true)}
            onMouseLeave={(e) => hoverStyle(e, false)}
          >
            Blogs
          </a>
        </li>
        <li>
          <a
            href="/gallery"
            style={linkStyle}
            onMouseEnter={(e) => hoverStyle(e, true)}
            onMouseLeave={(e) => hoverStyle(e, false)}
          >
            Gallery
          </a>
        </li>
        <li>
          <a
            href="/shop"
            style={linkStyle}
            onMouseEnter={(e) => hoverStyle(e, true)}
            onMouseLeave={(e) => hoverStyle(e, false)}
          >
            Shop
          </a>
        </li>
        <li>
          <a
            href="/contact"
            style={linkStyle}
            onMouseEnter={(e) => hoverStyle(e, true)}
            onMouseLeave={(e) => hoverStyle(e, false)}
          >
            Contact
          </a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
